INSERT INTO `ent_enterprise_info` VALUES (1,1208,'超心同创科技有限公司','莫智帆','一般经营项目是:程控交换机、传输设备、数据通信设备、宽带多媒体设备、电源、无线通信设备、微电子产品、软件、系统集成工程、计算机及配套设备、终端设备及相关通信信息产品、数据中心机房基础设施及配套产品（含供配电、空调制冷设备、智能管理监控等）的开发、生产、销售、技术服务、工程安装、维修、咨询、代理、租赁;信息系统设计、集成、运行维护;集成电路设计、研发;统一通信及协作类产品,服务器及配套软硬件产品,存储设备及相关软件的研发、生产、销售;无线数据产品（不含限制项目）的研发、生产、销售;通信站点机房基础设施及通信配套设备（含通信站点、通信机房、通信电源、机柜、天线、通信线缆、配电、智能管理监控、锂电及储能系统等）的研发、生产、销售;能源科学技术研究及能源相关产品的研发、生产、销售;大数据产品、物联网及通信相关领域产品的研发、生产、销售;通信设备租赁（不含限制项目）;培训服务;技术认证服务;信息咨询（不含限制项目）;企业管理咨询（不含限制项目）;进出口业务;国内商业、物资供销业业务（不含专营、专控、专卖商品）;对外经济技术合作业务;房屋租赁业务（持许可经营证）;以及其他法律法规不禁止的经营活动（依法须经批准的项目,经相关部门批准后方可开展经营活动）。,许可经营项目是:','914403001922038216','深圳市龙岗区坂田华为总部办公楼','1987-09-15 00:00:00','2',1,NULL,'广西梧州市万秀区梧州学院','一家涉及资产管理服务、房产交易服务和房产金融服务为一体的综合性房地产服务商，业务覆盖租赁、新房、二手房、资产管理、海外房产、互联网平台、金融、理财、后房产市场等领域，是国内领先的全产业链房产服务平台。','0',NULL,'2019-12-04 22:22:21','1');
