INSERT INTO `ent_project_cooperation_info` VALUES (10,25,'1.客户端引擎模块开发及优化；\n2.客户端游戏逻辑框架设计和逻辑开发','委托管理服务模式','1.熟练掌握C++，有使用C++开发游戏项目的经历，有Lua使用经历者优先；\n2.有3D引擎开发经验。熟悉UE4引擎者优先；\n3.精通图形学、物理引擎、状态同步、动画技术、粒子特效、相机控制、WWise音效开发任一方向；\n4.有良好的代码习惯和代码风格，出现性能问题、Crash问题时能够敏锐发现问题所在；\n5.有良好的沟通交流与合作能力，能够和美术和策划友好沟通；',391,NULL,NULL,'1','0',NULL),(11,26,'负责企业微信业务的数据分析工作；\n设计产品功能的数据采集方案，并搭建产品的数据指标体系；\n监测业务的日常数据，关注数据波动并能够及时分析和解读数据异常；\n针对产品和运营相关的业务问题，能够进行量化分析和数据建模，并提出优化策略；\n设计和分析A/B Testing实验以验证策略有效性，辅助业务决策。\n计算机科学、数据科学、统计学、应用数学等领域本科及以上学历；\n敏锐的数据洞察力、严谨的逻辑思维能力和系统的分析总结能力；','全程开店服务模式','熟悉常用机器学习及统计方法；\n熟练使用SQL/Hive语句；\n熟练使用Python/R/SAS等数据分析工具；\n熟练使用EXCEL/Tableau等数据可视化工具；\n符合以下条件优先：\n有Hadoop、Spark等平台的海量数据处理经验；\n有国内外互联网公司或其他行业的数据科学或用户增长经验；\n有TOB产品数据分析工作经验。',391,NULL,NULL,'1','0',NULL),(13,29,'1、依据公司开发项目的定位，结合设计院的总体规划设计，对项目整体以及单体进行优化设计，同时协调解决项目建设中的相关技术问题，从设计上保证产品质量；\n2、对项目产品以及工业厂房建筑功能的实现，对空间尺度的把握，对建筑物使用者的关注和了解，对工业园区的规划布局以及厂房设计提出新思路、新方案；\n3、配合各专业以实际情况进行设计图纸的变更和修改，监督检查现场施工的问题；\n4、与相关设计单位进行协调配合，协调项目内容各专业之间的设计配合；\n5、熟悉工业园区、厂房的消防、道路、管网、绿化等设计方案，擅长施工图设计，能准确理解把握项目需求；\n6、熟悉设计资料，了解设计要求和设计原则，正确进行设计，并做好专业内部给予其他专业的配合工作；','全权委托代理','1、建筑学及相关专业，从事本岗位工作3年以上；\n2、熟悉规划建筑方案设计和掌握建筑施工图能力，有工业园区设计方案及同职岗位尤佳；3、具有较强的专业技术能力，有大中型项目布局规划、单体优化设计工作经验尤佳；\n4、配合专业进度，制定详细的作业计划，并按照岗位要求完成各阶段设计、自校工作，\n减少差错；\n5、正确选用标准图及重复使用图，保证满足设计条件，对完成的设计文件应认真自校，\n保证设计质量；\n6、熟悉本专业各项规范，熟练使用设计相关等软件，具有较强的沟通协调能力，敬业负责，具备良好的分析解决问题的能力和团队合作精神；',NULL,19,NULL,'1','0',NULL),(14,27,'1、计算机或数统相关专业,本科及以上学历,5年以上相关工作经验；\n2、有丰富的数据仓库建设经验，具备大型数据仓库架构设计、模型设计、ETL设计的相关经验；\n3、精通Hadoop生态圈主流技术和产品，如Hbase、Hive、Storm、Flink、Spark，Kafka，Zookeeper、Yarn等，对Spark分布式计算的底层原理有深度理解，对复杂系统的性能优化和稳定性提升有一线实战经验，有多年实际开发和应用经验，对开源社区有贡献者优先；\n4、深入参与 Hadoop、HBase、Spark 等源码研究和二次开发，解决各种线上问题，参与到开源社区建设和代码贡献；\n5、熟悉Hive及相关HQL调优；\n6、熟悉掌握一门OLAP技术（如：kylin、impala、presto、druid等）\n7、具备较强的逻辑思考能力、学习能力、良好的沟通、组织协调能力和强烈的责任心，具备很强的分析和解决问题的','合作经营管理 ','1、负责技术规划和架构工作，主导系统的架构设计和核心模块开发，确保项目质量和关键性能指标达成；\n2、负责面向PB量级的数据查询、数据计算、数据存储以及数据模型与管理的总体架构与优化，提升数据查询的响应效率；\n3、负责研发技术发展方向，新技术领域的探索，将新技术应用到项目；\n4、参与技术团队建设和学习成长，为团队整体的知识积累，技能提升做贡献；',391,NULL,NULL,'1','0',NULL),(15,31,'1、负责建筑信息化项目的全生命周期管理，对项目立项规划、总控计划、系统建设、上线运行、项目验收等工作；\n2、负责项目团队组建与管理，负责项目全过程中的内、外部沟通、协调、组织资源，确保项目质量、进度、成本可控，控制项目风险；\n3、对客户进行深度服务，为客户提供整体解决方案，保持持续良好的客户关系，持续挖掘客户需求。\n任职要求：\n4、负责系统的现场部署、实施、维护、技术支持等有关工作，及时、有效协调资源解决项目实施过程中出现的疑难问题\n5、熟练使用Linux系统','合作经营管理 ','1、计算机专业，本科以上学历 ；\n2、同岗位3年以上项目实施经验，参与过项目交付的优先；\n3、有较强的客户经营意识，熟悉客户管理方式及行为特点，能够针对不同客户特点制定项目管理策略；\n4、工作地点：北京，并可以出差。\n5、有较强沟通能力；',NULL,19,NULL,'1','0',NULL),(17,30,'计算机相关专业本科及以上，5年以上相关经历；\n熟练掌握Java或Golang中的至少一种；\n熟悉SOA、微服务体系（SpringCloud或Istio优先），熟悉SpringBoot、NIO、高并发、分布式锁等知识优先；\n熟悉Redis、MQ、ELK、Nginx等中间件的使用、特性、及高可用方案；熟悉MySQL数据库，具有一定的数据库设计及调优经验，熟悉VUE、有前端经验者优先；\n熟悉Docker容器、Kubernate平台的基本使用，对应用镜像构建、发布、运行、更新的全生命周期有清晰的理解；\n熟悉Linux操作系统，熟练掌握常见安全、调优配置，及追查分析问题的操作命令；\n有一定的架构设计思维，有良好的软件工程规范；\n有公共平台型产品的建设经验者优先；','全程现场顾问参谋式','有清晰的逻辑思路，善于分析问题、解决问题，能掌握前后端完整链路的各环节者优先；\n善于沟通、善于学习，为人踏实、不浮躁者优先。\" \"负责技术中台的建设、运营、及部分运维工作，为开发团队提供高效、可靠的公共基础框架、服务、组件、中间件平台等；\n岗位职责：\n负责基础中间件平台（mq\\cache\\db\\gateway\\微服务\\devops\\容器平台等）的选型、设计、开发、高可用部署；\n负责公共基础微服务（搜索、通知、流程、权限、事件、队列、调度、语音等）的选型、设计、开发、高可用部署；\n负责基础开发框架、功能组件、Java/Go SDK等的设计、开发及封装交付；\n负责所建技术中台的使用指引、辅导、培训，深入对接开发团队的技术需求，迭代交付中台能力。',391,NULL,NULL,'1','0',NULL),(18,34,'1、3年以上渲染后期工作经验，对建筑表现工作富有热情、制作有创意、对建筑类型表达准确并有新意\n2、有美术专业基础。','全程现场顾问参谋式','1、精通3 Mars（主要）、Way（主要）Photoshop。有室内设计工作经验者优先；\n2、熟练掌握CAD、 Sketchup等设计软件；\n3、能够独立完成全实模场景制作，有园艺设计经验优先；\n4、具备良好的美术基础及审美能力，有较好的创意性；\n5、执着、认真、负责；快速适应快节奏工作；能与各部门的同事精诚合作；领悟学习能力强，极具上进心，不惧压力和挑战。\n注：面试时请携带近半年电子版作品。',NULL,19,NULL,'1','0',NULL),(19,28,'1. 全局保证整体测试交付的质量和效率;\n2. 能够识别产品、开发、测试中的问题、风险点，给出解决方案、风险预警和预防措施，推动测试、开发、产品团队共同改进；\n3. 为整体产品质量和研发效率负责，理解产品目标、提炼测试目标，设计并实现相应的工具、平台、解决方案，不断提升产品质量和研发效率；\n4. 了解国内外技术趋势，具有很好的前瞻性， 结合公司具体情况，引入和推广适合公司需要的新技术，做好测试团队的技术规划，确保团队朝着正确的技术方向持续前进','全程开店服务模式','1. 工科、计算机或其他相关专业本科以上学历。\n2. 精通软件测试理论、方法和过程，掌握多种测试技术(自动化测试、单元测试、性能测试等)\n3. 2年及以上的java开发或白盒测试经验，可以独立开发测试工具、框架。\n4. 熟练掌握python,shell等开发语言\n5. 具备大型系统的持续集成环境搭建、性能测试成功实施经验者优先\n6. 较强的人际技巧、优秀的执行能力，良好的沟通能力和积极主动精神，能够有力推动工作的开展',391,NULL,NULL,'1','0',NULL),(20,35,'1．负责公司合作的大型地产商客户的检测业务维护，并做二次开发；\n2．负责房地产商业务往来的商务活动；\n3．负责房地产行业的信息收集；\n4．负责房地产客户的跟进与关系维护。','全程开店服务模式','1．本科以上学历，材料，建筑，物理或土木类专业优先，形象气质佳，性格外向、活泼；\n2．具有2年以上销售工作经验，有较好的社交能力与人际关系，有良好的谈吐能力和开拓精神；\n3．具备营销方案的编制能力及文案能力；\n4．有房地产或检测认证行业销售经验者优先。',NULL,19,NULL,'1','0',NULL),(21,40,'1） 了解所报项目的总图设计、工程内容和审批单位的具体要求，催办工程项目的立项、审批等落实情况。\n2） 协助各地建管中心组织办理工程项目所有开工任务手续和土地勘察手续。\n3） 协助各地建管中心办理消防验收、规划验收、档案验收等竣工验收手续。\n4） 负责有关报表的填写、上报，及时向档案馆、资料员移交工程报建的所需的全部资料。\n5） 根据国家各省市有关报建报批政策法规的更新，及时掌握并传达有关政策的调整或变动，并对政策变化对项目开发的影响进行评估，提出建设性建议。\n6） 协助项目负责人制定项目报建报批计划，并跟进落实计划的完成节点。\n7） 负责开展各项目修规、规划方案设计及各阶段施工图审查工作，落实各阶段、各层次方案、施工图修改意见。\n8） 负责项目报建报批情况统计及汇报资料的准备工作。\n9） 收集项目报建报批相关资料，建立报建报批档案，整理归类各类文档。','委托管理服务模式','1) 本科及以上\n2) 一年以上相关工作经验\n3) 了解建筑规划设计各个方面的知识，了解建设项目实施的各个环节；\n4) 掌握政府建设项目行政审批流程及各个环节；\n5) 掌握建筑、规划与工程管理的理论知识及实操经验；\n6) 良好的沟通、组织协调能力；\n7) 掌握建筑设计软件及通用的办公软件。',NULL,19,NULL,'1','0',NULL),(22,32,'1、负责跟踪业界的标准与最佳实践，负责业务安全服务产品（防欺诈、内容安全等）的网络规划和架构设计；\n2、负责业务安全能力未来的规划以及新技术探路工作；\n3、主导具体业务安全技术解决方案以及业务安全服务的总体方案设计；\n4、深刻理解客户需求，能独立负责业务的网络安全/隐私保护工作、解决问题，促进项目成功；\n5、洞察业界DevSecOps发展趋势，输出安全工程能力提升规划','全程现场顾问参谋式','1、计算机相关专业本科以上学历，5年以上工作经验；安全领域3年以上经验\n2、具有网络安全架构设计经验；\n3、熟悉网络安全以及具有云基础设施安全的知识背景；\n4、精通主流的WEB安全技术，了解常见的安全风险，包括SQL注入、XSS、CSRF、SSRF等安全风险；\n5、熟悉国内外主流安全产品和工具，如：Nessus、Nmap、AWVS、Burp、Appscan等；\n6,、熟悉常见安全攻防技术，对网络安全、系统安全、应用安全有深入的理解和自己的认识，熟悉WEB平台渗透测试、后门分析、加固。',391,NULL,NULL,'1','0',NULL),(23,42,'1、全日制城市（乡）规划、土地资源与管理等专业毕业，大学本科及以上学历；\n2、1年以上工作经历，具有较好的方案构思及专业技能和设计能力；\n3、精通CAD、PS、AI、ID及OFFICE等常用软件，熟悉SKU、GIS等其他软件；\n4、熟悉本专业相关标准及设计规范；\n5、具有较好的团队合作精神和较强的组织协调能力；\n6、有驾照。\n7、有上进心、对工作有激情。','全权委托代理','珠海市司南人才资源服务有限公司（以下简称：司南人才）成立于2019年，是一家提供一站式就业服务、人企对接智库、中高端人才招聘服务、人才培训、人才交流、招聘业务外包、人力资源咨询等的“一站式”人才交流对接服务基地。\n',NULL,19,NULL,'1','0',NULL),(24,33,'1，参与vivo金融风控中台体系的建设，承担风控产品的研发工作，保障风控产品的高性能和高可用；\n2，参与风控实时数据相关系统的设计，开发；包括实时数据加工，计算，ETL， 管理， 监控等；\n3，建设风控相关的数据体系，持续集成相关工具产品，以及搭建机器学习平台、关系网络等相关工作；\n4，有互联网前沿风控的业务洞见，并能出具风控的数据技术解决方案，并指导落地。','全程开店服务模式','1，计算机科学及相关专业，有扎实的软件开发基础知识，对数据挖掘和机器学习有所了解，包括常用的机器学习算法和数据建模过程的优先。\n2，熟悉分布式计算和大数据的支撑平台, 有spark、flink 、storm经验优先；\n3，负责过机器学习算法，系统和平台的开发