经济金融类相关专业，本科及以上学历；\n2、有过FRM相关课程的学习经历；\n3、能够熟练使用PPT、Word、Excel等Office办公软件；\n4、热爱教育培训工作，踏实细心、认真负责。',391,NULL,NULL,'1','0',NULL),(40,57,'1、大学本科以上学历，计算机相关专业，具备Java开发经验，工作5年以上；\n2、Java基础扎实，良好的代码风格，熟悉J2EE规范，熟悉常用设计模式，对面向对象、领域驱动开发有一定的经验；\n3、熟悉JVM性能优化、对系统性能优化层面有自己的见解；有互联网公司Web开发和性能调优经验经验者优先；\n4、熟练使用开源技术以及框架（spring、Mybatis等）；\n5、熟练使用MySQL，Oracle数据库其中的一种；熟悉Linux环境以及操作，Git、MVN的使用；\n6、熟悉部分NIO框架（如Netty）、RPC调用框架(如Thrift)、消息队列框架(RabbitMQ/Kafka等)，了解分布式协调服务 Zookeeper者优先；\n7、能够及时关注业界最新技术动态和发展方向，能够独立研究并乐于分享技术，同时要有强烈的责任心、主动性和团队合作精神；','委托管理服务模式','美团的使命是“帮大家吃得更好，生活更好”。作为中国领先的生活服务电子商务平台，公司拥有美团、大众点评、美团外卖、美团单车等消费者熟知的App，服务涵盖餐饮、外卖、打车、共享单车、酒店旅游、电影、休闲娱乐等200多个品类，业务覆盖全国2800个县区市。截至2019年6月30日止',NULL,19,NULL,'1','0',NULL),(41,49,'1. 业财一体化和国际化财务系统建设，包括资金管理、报销管理、收入与支出管理、国际化支付等。\n2. 全球采购和供应链系统\n3. 国际化的企业业务流程与办公系统、资产管理系统等\n4. 全球化的智能行政管理系统\n5. 合同、法务系统等','全程现场顾问参谋式','1. 计算机及其相关专业， 本科及其以上学历，1-5年工作经验，至少1年以上互联网工作经验。\n2. 熟练掌握HTML／HTML5、Javascript、CSS/CSS3等相关语言和规范。\n3. 熟悉主流前端框架，有项目经验为佳。\n4. 有企业应用系统开发经验， 熟悉互联网toB业务流程优先。',391,NULL,NULL,'1','0',NULL),(42,58,'1、负责京东数据中台数据产品的系统开发及架构设计，保证系统稳定性、性能优化等相关工作；\n2、保持技术前瞻性，持续推动系统架构的合理性；\n3、探索并应用大数据前沿技术，如海量数据的即席查询、微服务等。\n4、针对产品性能和架构优化能从技术方面给出可行性见解,确保系统的架构质量。','合作经营管理 ','1、JAVA基础扎实，包括JVM、IO、多线程、并发、网络，深刻理解面向对象、设计原则、封装抽象等；\n2、熟练使用常用的Java技术框架，并对java web的各种开源框架如Spring、Struts、Hibernate等有深入的应用和优化经验，掌握原理和机制；\n3、优秀的抽象设计能力,思路清晰,善于思考,能独立分析和解决问题。\n4、有丰富的分布式,高并发,高负载,高可用性系统设计经验,熟悉分布式缓存,消息队列,RPC等内部机制等\n5、较深入的了解浏览器端的框架及技术架构。',NULL,19,NULL,'1','0',NULL),(43,50,'工作经验：2-8年均可；\n熟悉Unix/Linux，熟悉C/C++ 或go；\n扎实的软件知识结构(操作系统、软件工程、设计模式、数据结构、数据库系统、网络安全)；\n具备良好的分析解决问题能力，良好的沟通协调能力；\n有海量服务器开发经验优先。','全程开店服务模式','负责腾讯视频app移动后台的设计与开发；\n负责腾讯视频弹幕、直播服务等系统的设计与开发；\n负责腾讯视频看单、push等系统的设计与开发。',391,NULL,NULL,'1','0',NULL),(44,59,'1、主导或参与系统设计、研发、部署等相关工作；\n2、研发基础服务组件，解决共性需求，减少重复开发与运维；\n3、有较强的系统问题分析经验和能力，能够解决复杂的系统问题；\n4、参与部分生产系统维护工作，解决生产系统问题及进行系统调优。','全程开店服务模式','1、大学本科(统招)及以上学历，计算机相关专业；\n2、熟悉TCP/IP协议，熟练掌握Linux网络编程和多线程编程技术；\n3、熟练掌握Linux环境下的C/C++/Java/Ruby/Go/Python/Shell/PHP等一种以上编程语言；\n4、有较强的系统问题分析经验和能力，能够解决复杂的系统问题；\n5、熟悉 redis、memcache、消息队列等基础技术；\n6、具有系统性能分析及优化经验者优先；\n7、开源社区活跃贡献者优先。',NULL,19,NULL,'1','0',NULL),(45,52,'1、负责直播平台架构设计与重构，包括但不限于 主播平台 / 公会平台 / 运营平台；\n2、负责直播平台的开发和迭代；\n3、负责直播各维度 数据统计、分析和挖掘；\n4、和产品经理、运营配合，深度参与产品需求讨论、数据分析、功能定义等。','全程现场顾问参谋式','1、本科及以上学历，计算机、通信等相关专业；\n2、具备强悍的编码能力，有扎实的数据结构和算法功底；\n3、熟悉linux开发环境，熟悉掌握至少一门高级语言：C/C++/Java/Go/Python；\n4、熟悉Hadoop，Hive，Spark，Storm，Kafka等常用工具；\n5、有内容集成、离线分析、数据挖掘、大型工程架构经验者优先；\n6、工作认真细致踏实，强大的抗压能力，较强的学习能力、分析解决问题能力；\n7、积极乐观，责任心强，工作认真细致，逻辑缜密，具有良好的团队沟通与协作能力。',391,NULL,NULL,'1','0',NULL),(46,60,'熟悉Unix/Linux，熟悉C/C++ 或go；\n扎实的软件知识结构(操作系统、软件工程、设计模式、数据结构、数据库系统、网络安全)；\n具备良好的分析解决问题能力，良好的沟通协调能力；\n有海量服务器开发经验优先。','委托管理服务模式','负责腾讯视频app移动后台的设计与开发；\n负责腾讯视频弹幕、直播服务等系统的设计与开发；\n负责腾讯视频看单、push等系统的设计与开发。',NULL,19,NULL,'1','0',NULL),(47,61,'负责小米推荐系统的后台架构研发，支持亿级用户个性化推荐请求，搭建高可用、高性能的推荐架构；\n负责大规模机器学习平台的搭建，实现模型预测、实时数据流等模块的研发。','全程开店服务模式','2年以上Java或者C++开发经验，学习能力突出；\n扎实的计算机基础理论、数据结构和算法功底，优秀的编程能力。\n精通Java，Scala，熟悉Linux下操作；\n熟悉hadoop生态系统常见项目的使用（hdfs、hive、hbase、spark等），具有spark开发经验，有实际大数据项目优先；\n有机器学习，自然语言处理、知识图谱等经验者优先；',NULL,19,NULL,'1','0',NULL),(48,54,'1. 与客户紧密合作，理解客户需求定义SoC SPEC\n2. 按照需求定义SoC系统子系统架构，功能和规格， PPA量化分析\n3. 与Firmware和软件团队紧密合作，构建系统软件和应用软硬件划分和接口\n4. RTL代码、调试，时序、功耗优化\n5. 关注工业和学术界体系结构发展，并制定未来芯片路线图','合作经营管理 ','1. 微电子、计算机或电子工程硕士及以上学位\n2. 拥有设计高性能SoC芯片并参与整个流程的成功经历\n3. 熟悉SoC 低功耗、安全、调试、可靠性等系统级特性架构和设计\n4. 熟悉高性能网络芯片架构、协议和算法者优先\n5. 熟悉高速数据接口，数据通道traffic管理、调度和流量控制算法与实现者优先',391,NULL,NULL,'1','0',NULL),(49,62,'工作职责:\n1.负责集团数据体系的规划、 架构设计、数据治理与实施管理,保障系统架构的合理性、 可扩展\n性及经济性；\n2. 牵头制定团队的技术战略储备、 技术发展路线,持续提升信息 系统的有效性和效率,主要包括但不限于技术战略、总体应用及集成框架、主数据架构、交易数据架构和分析数据架构,并形成企业数据地图及企业数据字典等。\n3.设计并牵头描建数据中台,建立大数据分析体系。负责从大规模数据中抽取有用信息并为相关的应用建立统计模型。\n4.维护和升级现有系统的数据架构发展规划,满足新业务实现要求\n5.负责行业信息化动向跟踪 ,市场竞品分析 ,挖掘创新点应用到我们平台\n6.设计实现数据质星/监控等数据平台的业务系统\n7.牵头信息化规划与更新','委托管理服务模式','1、具备15年以上软件行业工作经验,有丰富的T咨询与软件的设计经验;\n2、有腾讯、阿里从业经验,有现代零售企业的工作经历,创业型公司( 100个开发团队)担任架构师。',NULL,19,NULL,'1','0',NULL),(50,63,'-负责语音识别声学模型训练相关工作\n-跟踪语音识别声学模型训练最新技术\n或\n-负责语音识别语言模型效果分析、训练及优化工作\n-跟踪语言模型深度学习前沿算法研究及应用','合作经营管理 ','-硕士及以上学历，信号处理、计算机、电子信息、自动化、模式识别等相关专业\n-语音识别3年以上工作经验\n-深度学习/语音识别相关算法和研究\n-熟练掌握 C/C++, 编程能力强；熟悉 Linux 环境开发；熟悉一门脚本语言\n-熟悉 Kaldi/HTK 者优先\n-具备优秀的逻辑思维能力，对解决挑战性问题充满热情，善于解决问题和分析问题\n-有强烈的上进心和求知欲，善于学习新事物\n-良好的团队合作精神，较强的沟通能力和学习能力',NULL,19,NULL,'1','0',NULL),(51,64,'1.根据本公司战略、业务需求及行业趋势制定金融技术规划方案并把握整体技术方向；\n2.负责公司互联网化金融平台建设、系统架构设计、布局部署，协助中科云谷全力支持大型制造型企业金融服务板块的升级转型以及在金融科技方向的发展；\n3.对重点及创新项目提出有效建议，负责平台重点及创新业务流程设计，确保项目的顺利运行；\n4.梳理业务、产品、数据架构并优化现有系统中产品、模块；\n5.跟踪相关技术领域的发展趋势，保持在业界的领先水平；\n6.制定创新技术的培训计划并实施，提高团队整体技术能力','全权委托代理','1.在大型银行或者知名金融公司担任技术架构负责人的相关工作经验。有推动传统制造型企业金融服务业务核心业务系统向互联网金融模式转型升级的经验\n2.熟悉互联网金融行业标准和技术规范，有该行业系统应用架构设计与研发经验，对互联网领域技术的变化有敏锐的嗅觉；\n3.对金融领域大数据建模、数据挖掘及数据分析，智能风控深度学习算法，区块链技术架构及应用场景，微服务、容器云等技术的运用有独到见解，需要有其中一个或多个相关项目的实施经验；',NULL,NULL,1,'1','0',NULL),(52,66,'1.负责ERP系统开发任务的拆分以及开发团队的管理，确保按时、按质完成公司的各项开发任务\n2.主导/参与ERP系统的技术难题攻关，持续提升核心系统在高并发、海量请求数下的高处理性能\n3.负责ERP系统开发框架规范的制定与实施，确保开发的规范性与效率\n4. 产品/项目总体架构规划、设计、原型验证及核心功能开发等工作；\n5. 能够按照需求进行系统整体架构设计，指导项目实施；','合作经营管理 ','1 . 3年以上技术开发经理经验或技术团队管理经验\n2. 5年以上JAVA 或许 PHP 开发经验，技术过硬，1年以上团队管理及系统架构经验；\n3. 精通JAVA Spring Framework，Spring Cloud，或者 PHP Laravel 5.5 或 Zend Framework 2；\n4. 具备产品开发的管理思维，熟练系统架构 / 代码架构 / 代码框架以及各种开源技术的应用\n5. 具备技术管理的思维和实践能力，能够搭建支撑开发各项工作进展的技术管理体系\n6. 具备技术团队管理的能力，具有良好的沟通与协作能力、需求理解与分析能力\n7. 具备用户体验的基本设计理念',NULL,NULL,1,'1','0',NULL),(53,67,'1、负责产品的研发、架构设计、产品数据库设计、前后台功能模块开发；\n2、带领团队成员共同完成项目开发任务，对产品的开发进度和质量负责；\n3、解决各类技术疑难问题，营造良好的研发氛围，提升团队整体技术水平。','全程现场顾问参谋式','1、统招本科及以上学历，计算机及相关专业，10年以上工作经验，有政府经验优先。 \n2、熟悉常见安全攻防对抗手段，有实际的渗透测试及安全防护经验。\n3、熟悉常用网络安全扫描工具的使用。\n4、了解常见安全漏洞及技术原理。\n5、了解行业主流的安全标准、安全模型、安全解决方案、安全体系建设类知识。\n6、有激情有进取心，乐于持续学习，抗压性强，良好的服务意识和成就导向。',NULL,NULL,1,'1','0',NULL),(54,68,'1. 负责安全领域的体系技术架构规划及实施落地；\n2. 负责应用系统架构优化、质量提升，性能调优，关键领域的技术攻坚；\n3. 战略级项目的技术架构设计及落地，协同及帮助外围业务团队共同达成目标。','全程现场顾问参谋式','1. 具有扎实的JAVA技术功底，熟悉NOSQL数据库，缓存技术，流式计算等相关技术的原理，具有较强的技术攻坚能力；\n2. 具有体系化的架构设计能力，能够帮助领域完成阶段性架构规划；\n3. 责任心强，具备良好的团队合作精神和承受压力的能力；\n4. 具备给予团队技术辅导，帮助团队技术提升，带领团队拿结果的能力',NULL,NULL,1,'1','0',NULL),(55,69,'1、承担核心功能代码编写，重点项目架构设计开发；\n2、深入理解业务需求，分析和发现系统的优化点，负责推动产品性能和架构优化；\n3、新人指导、培训及Code Review，主导技术难题攻关，提升团队整体技术水平；','全程开店服务模式','1、计算机相关专业本科及以上学历，三年以上Java Web应用软件开发经验；\n2、精通Servlet、Spring、Hibernate、iBatis、Velocity开发，对SOA模式有深入理解\n3、熟练MySQL，对数据库有较强的设计能力，同时熟悉大数据相关技术；\n4、熟悉Maven项目配置管理工具，熟悉Tomcat、Jboss等应用服务器，熟悉高并发处下的性能优化；\n5、熟悉网络编程，具有设计和开发对外API接口经验和能力；\n6、具有良好的沟通，团队协作、计划和创新的能力；',NULL,NULL,1,'1','0',NULL),(56,70,'负责阿里云产品和客户项目的交付测试工作，参与软件产品测试的全流程，包括参与需求分析、设计评审，制定测试计划，设计和执行测试用例，进行缺陷跟踪和软件质量分析等。\n带领生态伙伴和客户的测试团队，把控整体项目质量。包括制定测试计划，分配测试资源，构建测试环境，执行集成测试，回归测试，UAT，线上质量监控等。\n持续改进阿里云产品的交付质量，并通过测试流程和方法创新，努力提升研发的质量和效率。','委托管理服务模式','1.工计算机或其他相关专业本科以上学历，3年以上软件开发、自动化测试工作经验\n2.熟悉C/C++/Java等至少一种编程语言，有java开发经验或者java自动化工具开发经验，熟练使用java和相关工具包\n3.熟悉互联网、云技术、Android/IOS无线产品、搜索、大数据处理、分布式系统、数据库和网络等业务领域测试经验者优先\n4.精通研发流程和测试用例设计,熟练掌握单元测试，接口测试，持续集成，压力测试等测试方法\n5.担任过中大型项目测试负责人，逻辑思维和谈判能力强，能从整个项目的角度出发解决项目质量冲突\n6.为人踏实进取，激情抗压，善于团队合作，以结果和行动为准则，努力追求成功。',NULL,NULL,1,'1','0',NULL),(57,71,'1.负责具体业务功能的开发（拍卖、会员、商品、交易、店铺、资金等），深入发掘业务需求，独当一面，包括需求分析、架构设计和代码实现；\n2.持续优化系统架构，提高系统在高并发、大流量下的容灾容错能力，保证系统的高可用性（性能、安全、容量）；\n3.通过梳理和抽象，沉淀通用性的平台或服务能力，发现和解决存在的技术问题，并在具体的业务场景中进行验证推广；','全程开店服务模式','1. 本科及以上学历，计算机软件或相关专业；\n2. 3年及以上使用JAVA开发的经验，JAVA基础扎实，理解io、多线程、集合等基础框架，对JVM原理有一定的了解，对Spring,ibatis,struts等开源框架熟悉；\n3. 熟悉分布式系统的设计和应用，熟悉分布式、缓存、消息等机制；能对分布式常用技术进行合理应用，解决问题；\n4. 掌握多线程及高性能的设计与编码及性能调优；有高并发应用开发经验；\n5. 掌握Linux 操作系统和大型数据库（Oracle、MySql）；对sql优化有丰富的经验；\n6. 学习能力强，适应能力好，有强烈的责任心，具备耐心/细心的品质；',NULL,NULL,1,'1','0',NULL),(58,72,'1.  负责公司内部研发效能提升相关的Web信息系统的开发、运维；\n2. 负责系统需求分析、设计、技术方案、推广运营等工作。','合作经营管理 ','1.  本科或硕士，5年以上工作经验。（此条为必须）\n2.  精通python编程，特别是基于的Django相关系统开发\n3. 熟悉Vue、 React系统相关技术栈\n4.  具备较强的问题分析能力、创新能力，以及良好的沟通能力； \n5.  熟悉软件开发流程、具备需求分析和系统设计能力。  \n6. 具备良好的代码编写习惯和质量意识。',NULL,NULL,1,'1','0',NULL),(59,73,'1、负责公司支付、信贷、基金理财、保险等金融产品的服务器端开发工作；\n2、主导金融产品系统及技术改造类项目的系统分析与设计工作，承担核心功能代码编写，开发与维护系统公用核心模块；\n3、参与项目的需求分析、需求管理；负责相关需求的功能设计、开发，单元测试，调试，上线等工作；\n4、负责指导、培训普通开发工程师，审核开发工程师的设计与研发质量；\n5、协作横向团队，确保系统架构内外设计合理，保障项目质量与进度。','全程开店服务模式','1、全日制本科及以上学历，计算机或其它相关专业，5年及以上开发经验；\n2、有金融行业经验、知名互联网公司、大型分布式平台工作经验者优先；\n3、扎实的JAVA编程基础，理解IO、多线程、集合等基础框架，对JVM原理有一定的了解；\n4、熟练使用Spring、SpringMVC、MyBatis、Dubbo等框架；熟练使用MySQL数据库，掌握基本的SQL优化技巧；\n5、熟悉Redis，Zookeeper，MongoDB，MQ等常用的中间件和NoSQL数据库；\n6、熟悉常用的设计模式，注重代码质量与可维护性；掌握多线程及高性能的设计与编码及性能调优，有高并发应用开发经验；',NULL,NULL,1,'1','0',NULL),(60,74,'1.结合公司内部算法需求，负责数学建模，算法研究与开发，包括但不限于运维，运营和云服务内部前沿算法技术研究与落地；\n2.根据数据类型及结构、算法框架及原理理论，结合业务场景评估算法可行性，并建立实用性模型，设计算法解决方案，完成开发验证；\n3.负责跟踪人工智能领域最新技术和动态，队已有算法进行改进。','全程现场顾问参谋式','1.本科及以上学历，计算机、应用数学、人工智能、模式识别、统计学等相关专业；\n2.本科三年以上工作经验或硕士1年以上工作经验；\n3.精通机器学习常用算法原理和实现，深度学习，理解CNN，RNN原理，有实际工程经验者优先；\n4.熟练进行Java，Python，C，C++中一种或多种代码编写；\n5.英语阅读能力良好，对人工智能领域有浓厚兴趣，大数据开发经验者优先；\n6.计算机相关基础知识扎实，有存储，数据库，大数据经验者优先；\n7.具有较强的内外部沟通能力和协调能力，视野开阔 思维敏捷，创新能力强；\n8.工作认真，积极主动，能及时高效的完成各项工作，具有团队精神。',NULL,NULL,1,'1','0',NULL),(61,75,'1、负责平台需求受理、分析与设计工作，承担核心功能代码的编写及系统运维工作，确保系统安全性及稳定性；\n2、负责平台复杂问题的解决，针对平台的发展进行思考并制定合理的架构规划；\n3、指导和培训新员工，保障新员工设计与研发质量，确保其快速成长；\n4、负责协同项目相关方，确保跨团队项目落地。','合作经营管理 ','1、Java基础扎实，具备三年以上的Java研发经验；\n2、熟悉分布式系统的设计和应用，熟悉分布式框架、中间件、数据库等机制，能对分布式常用技术进行合理应用解决问题，有2年以上大型分布式系统研发经验优先；\n3、具有大型电子商务网站、银行业核心系统、互联网金融系统研发经验、以及高并发、稳定性技术经验的优先；\n4、具备数据和算法开发及应用经验者优先；\n5、具有良好的沟通技能，团队合作能力，追求极致的心态。勤奋好学，耐得住寂寞，扛得住压力。',NULL,NULL,1,'1','0',NULL),(62,76,'1.人脸检测、人脸特征点定位、人脸特征提取和比对、人脸属性识别、活体检测等人脸相关算法的研究、开发和改进。\n2.目标检测相关算法的研究、开发与改进','委托管理服务模式','1.硕士及以上学历，模式识别、机器学习、计算机、数学、图像处理等相关专业；\n2.掌握深度学习基础知识，具备实际项目经验优先，具备与人脸识别,目标检测相关项目经验优先；\n3.在GPU，DSP，x86或arm等硬件平台上进行过算法的开发和优化\n4.熟练掌握C/C++，熟悉Python，熟悉Caffe、Tensorflow等至少一种深度学习框架；\n5.较强的论文检索，英文专业文献阅读、理解和算法实现；\n6 .具备人脸识别、深度学习算法实习经验，或参赛并取得较好名次优先。',NULL,NULL,1,'1','0',NULL);
