INSERT INTO `ent_project_info` VALUES (25,'智能物料搬运机器人','已登记','上级下达','200万元',2,'	在如今智能科技的高速发展下，机器人已经逐渐的走向了人们的生活当中，减少了许多的劳动力，解放了双手。智能物料搬运机器人是通过寻迹传感器识别地面上的印记，按照这个印记前往指定地方扫描二维码获取任务，再通过颜色传感器来准确的抓起相应的物品，并放到指定区域，它是集扫描，识别，搬运与一体的智能机器人。',NULL,391,NULL,'1'),(26,'基于STM32单片机设计的智能宠物家居系统','已登记','自选项目','300万元',2,'智能宠物家居系统以STM32单片机为核心控制元件，主要包括主控模块、自动投食模块、温控模块、GSM短信报警模块、串口屏显示模块等6个部分。系统上电后，进入自动温控模式，通过温度传感器实时采集宠物生活环境温度，若温度太高，打开降温设备；若温度太低，打开升温设备，让宠物家居环境维持在适宜温度，为宠物的健康成长提供一个舒适的家；当主人不在家时，开启自动投食模式，定时定量为宠物提供食物。通过压力传感器可检测食物剩余量，若超过设置的报警值，将通过GSM短信报警模块将信息传输到主人手机，让主人及时处理，从而实现自动投食功能。',NULL,391,NULL,'1'),(27,'沃替西汀药-药共晶及新盐型的研究','已登记','横向联系单位委托','500万元',2,'沃替西汀，是2013年经美国食品与药品管理局（FDA）批准上市的Brintellix的活性药物成分（API），用于治疗成人重度抑郁症。Brintellix本质上是一种沃替西汀的氢溴酸盐。因为沃替西汀水溶性低、稳定性差，影响了其在体内吸收的效果，所以沃替西汀最终是以氢溴酸-新盐型的形式上市，本研究的目的是利用晶体工程理论设计沃替西汀药-药共晶及新盐型，探讨不同的晶体结构对沃替西汀理化性质的影响，以期望制备出药学性能更优良（水溶性高且稳定性好）的沃替西汀新的固态形式。药-药共晶和盐型是药物晶体工程热点研究领域，一方面可以通过药-药共晶和盐型改善药物的理化性质，从而改善药物的生物利用度；另一方面，药-药共晶和盐型所用到的共晶物质（CCF），本身已经是上市的药物，安全性高，不需要进行药物上市后期所需要进行的毒性及安全性实验，缩短了研发周期，节约了成本，具有重要的意义。',NULL,391,NULL,'1'),(28,'一“箱”情愿跟你走','已登记','上级下达','600万元',2,'本项目是以STM32F103ZET6单片机为核心控制元件，设计一款可爬楼式智能跟随行李箱。系统以单片机为主控核心，主要由自动跟随模块、爬楼模块、电源模块、防盗模块、语音提醒模块组成，具有自动跟随、爬楼、充电、自动报警、搭载儿童、语音提醒等人性化功能。本设计性能出众，适用性强，性价比高，使出行更加便捷，解决了目前行李箱笨重不便携带、易丢失、上楼梯不方便等问题，能够让人们放开双手轻松自由地出行，可以在各种场合使用并推广。',NULL,391,NULL,'1'),(29,'茶籽壳微纤化纤维素的制备','已登记','上级下达','500万元',1,'天然纤维素是地球上最丰富的生物质资源，是自然界中分布最广的生物高分子，它存在于各种各样的生物如植物、动物以及一些细菌等中。微纤化纤维素（MFC）是从天然纤维中提取出的一种纳米级的纤维素，它不仅具有具有纳米颗粒的特征，还具有一些独特的强度和光学性能，因而在复合材料，制药，化妆品，电池，造纸等领域具有广阔的应用前景。我们实验室前期已经成功地以海带纤维素为原料制备出了海带纳米纤维素，此外我们打算再从茶籽壳再制备出一种不同来源的MFC。',NULL,NULL,19,'1'),(30,'利用氢键超分子合成子改善非布索坦药物理化性质的研究','已登记','上级下达','500万元',2,'	难溶性羧酸类药物非布索坦是近40年来FDA批准的首个抗痛风新药，具有良好的市场前景。但是由于其水溶性低（12.9 mg/L），导致药物溶出速率下降，进而影响到体内吸收。本项目利用氢键超分子自组装的原理制备非布索坦的新的固态化学形式，以期望改善其水溶性，增加溶出速率，进而达到提高非布索坦生物利用度的效果。',NULL,391,NULL,'1'),(31,'六堡茶糖果制作工艺研究	','已登记','横向联系单位委托','400万元',1,'六堡茶是广西所特有的名茶，属后发酵茶类，性温，具有清热润肺、消暑祛湿,明目清心、帮助消化等保健作用。本项目选取六堡茶成品茶为原料，超声辅助法浸提茶叶得到茶汁，经过滤、浓缩、干燥和粉碎等工序而制成粉末状或颗粒状固体，添加糖浆、香料、或其他一些添加剂，制成既含有传统茶叶的营养成分和风味物质，且具有茶对人体的一切功效的糖果,以其清洁卫生、便于携带、口感丰富、老少适宜 等优点而受大众瞩目, 是一种很有前景的固体糖果。\n',NULL,NULL,19,'1'),(32,'漆酶催化降解六堡茶茶叶渣中木质素性能的研究','已登记','上级下达','600万元',2,'随着人类社会的快速发展，世界能源的消耗量也日益加剧，三大能源（煤、石油、天然气）毕竟来源有限，早已不能满足人类社会的需要。木质素是自然界中含量仅次于纤维素的一类可再生有机物，它来源广泛。本项目利用漆酶在“渗透调节物质”作为组分的溶剂中降解六堡茶茶叶渣中木质素，实现木质素和纤维素分离，并考察了溶剂pH值、反应温度、反应时间、漆酶添加量等因素，对漆酶催化降解六堡茶茶叶渣中木质素性能的影响，得到最佳降解条件，并对降解产物进行检测、分析。本项目为天然产物中木质素的降解、分离和利用提供了新方法。',NULL,391,NULL,'1'),(33,'基于机器学习恶意流量分析系统','已登记','上级下达','600万元',2,'根据国外公司 Distil Networks 发布的报告，2017年机器流量占全网流量的42.20%，其中恶意机器流量占21.80%。该项目通过流量监测出恶意软件的程序，通过公开的含有恶意软件的黑名单，通过对用户的网络访问请求进行分析，判断其使用访问了恶意软件的服务器地址，下载链接，可疑域名，可疑文件名来判断是否遭受了恶意软件的感染。',NULL,391,NULL,'1'),(34,'不同寄主桑寄生红外光谱鉴别及主要成分的比较研究	','已登记','自选项目\n','600万元',1,'桑寄生是我国传统常用中药材之一，具有祛风湿、补肝肾、强筋骨、祛风湿、安胎元等功效。在自然条件下桑寄生寄主植物具有复杂多样的生物学特征，不同寄主植物来源的桑寄生药材内在成分存在差异，从外观上无法区别。本研究利用红外光谱专属性强、灵敏度高、简便迅速等特点，探讨不同寄主来源桑寄生的红外光谱特性，并比较不同寄主来源桑寄生主要成分的差异，以期为桑寄生药材质量控制及开发利用提供参考依据。',NULL,NULL,19,'1'),(35,'互联网平台下乡村学习资源包的开发与升级','已登记','自选项目\n','600万元',1,'“互联网+学习资源包”是充分利用信息化的精准服务和智能环境，以覆盖每个帮扶点或活动场所的网络现状为参考，一方面向受助儿童提供信息化教学实践活动，提供定期定量定质的教学资源，另一方面链接赞助平台，如社会爱心人士、企业，通过线上分享，即时反馈等方式，加强双向了解与认识，增强可信度与真实性，着眼于解决受助地区的师资条件、课程开设单一等问题，推动规范统一的教育云服务，保证学习资源的充分利用与升级改造。',NULL,NULL,19,'1'),(36,'基于大数据下的社交隐私泄露危害预警系统','已登记','上级下达','600万元',2,'	由于社交网络上的个人信息很难得到有效保护，我们这种事无巨细的分享方式让个人隐私的泄露在所难免，至于由于消费者数据泄露导致的隐私泄漏。 本次研究，目的就在于研究出一套社交隐私泄露危害系统，以便揪出判断个人在社交网络中个人隐私泄露的严重程度，并且分析出存在泄露危害的信息，让用户个人对存在泄露个人信息信息危害的信息进行处理，充分保护人们在进行网络社交时个人隐私泄露等一系列安全问题。',NULL,391,NULL,'1'),(38,'大学生网络政治参与存在的问题及解决路径','已登记','横向联系单位委托','600万元',2,'	随着我国互联网的不断发展、普及，我国网民数量不断增加。人们的网络生活也变得越来越丰富，各种新闻头条，时事政治不断进入大众视野。人们在阅读后还可以在评论区发表自己的观点或看法，参与讨论。但是，在一些与政治有关的网络评论区里，我们有时可以看到反对政府的政策或是其它与我国既定大政方针相悖的言论，有些甚至是过激的。参与这些评论的不乏普通大众，更有具备一定专业知识的大学生。细看这些言论，我们可以明显感到其中大多数的评论不合理不正确。这主要是评论人自身的政治理论素养和辩证思维能力不足所导致的对国家政策的片面理解。也是由于我们思想政治宣传工作没有做细致做到位。那么，对于此类问题，宣传部门要做的是有针对性、实效性地开展工作，纠正大学生网络政治参与认识上的误区与不足，从而解决思想矛盾，提高大学生对国家政治的认同感和幸福感。就此而言，本项目的工作具有非常重要的现实意义。',NULL,391,NULL,'1'),(39,'苍梧六堡茶制作技艺商业插画设计','已登记','上级下达','800万元',4,'	苍梧六堡茶制作技艺是国家级非遗项目，是梧州精神和文化的体现，保护和传承极具地方特色的非遗项目具有积极的意义。 本项目主要通过设计完成国家级非遗项目——苍梧六堡茶制作技艺的系列商业插画，将梧州非遗以商业插画的手法展示出来，进行保护与传承，推广传播。 在项目实施过程中，可以对大学生资源和社会资源进行合理有效的配置与整合，把其已有的专业知识运用到创新训练的实践中，在锻炼综合能力的同时，提高大学生的社会实践能力，从而增强社会竞争力。',NULL,391,NULL,'1'),(40,'楼梯升降机','已登记','自选项目\n','600万元',1,'主要为行动不便者提供上下楼梯服务，在楼梯上安装导轨，导轨上安装座椅，座椅上设有背靠，放脚板，扶手，背靠上设有安全带，通过传送带在导轨上面上下楼梯，楼梯上下设有按钮，用来呼叫升降机。座椅可折叠，减少占用楼梯空间，用起来方便。',NULL,NULL,19,'1'),(41,'精准扶贫建档立卡大学生毕业就业情况调查','已登记','上级下达','600万元',4,'	我国一大战略目标就是实现2020年要打赢扶贫攻坚战。国家为此做了许多政策的鼓励，发动各种社会团体共同发力打赢扶贫攻坚战。我们团队主要研究精准扶贫建档立卡大学生毕业就业情况。主要选择梧州学院的该类学生作为研究对象。研究的内容主要是国家的精准扶贫政策、学校的就业帮扶措施、当地政府对精准政策的落实对建档立卡的毕业生就业情况的影响。学校是该类学生精准扶贫帮扶就业的的具体实施者。我们希望通过这次调查研究能够从扶贫政策和学校的帮扶具体方法中总结反思，为以后的学校帮扶工作的开展提供具有建设意义的措施。',NULL,391,NULL,'1'),(42,'交通执法预警平台','已登记','横向联系单位委托','800万元',1,'本项目结合梧州市公安局视频监控和道路交通监控系统数据，通过对道路交通视频、图像的特征信息分析，提取和分析小汽车、摩托车、助力车、电动车、三轮车、小型货车、大型货车的特征信息，达到道路交通执法部门开展的“交通违法”、“套牌车预警”、“助力车收缴”、“泥头车集中整治”等执法目的，通过对实时或非实时车辆特征的提取与分析，达到目标或嫌疑车辆的查找与分析，并通过执法设备的地理位置标注，利用百度地图等地图API接口实现在地图上目标或嫌疑车辆的轨迹标注和描述。对于“车辆套牌”、“集中整治”通过实时分析和提取车辆特征，对满足特征的车辆实时推送到执法警务端，执法人员可根据警务端推送信息实时控制嫌疑车辆，达到快速、准确的执法目的。',NULL,NULL,19,'1'),(43,'大数据服务-人才培养及第三方招聘平台','已登记','上级下达','500万元',4,'	随着科学技术进步，人类活动产生的信息形成的数据可以被越来越多的处理，从而产生巨大的价值，从商业到科学，从政府到艺术，大数据已经覆盖了包括衣食住行等与日常生活密切相关的产业，但在人力资源行业，特别是校园招聘方面仍然有巨大的开发前景。 本项目服务人群目标是各高校在校生、应届毕业生及社会企业人力资源部门，致力于通过互联网+大数据+服务模式打造一个客观诚信的第三方招聘服务平台，通过大数据分析与定向培养，为企业提供优秀的发展伙伴，增强大学生实践技能促进就业，以此整合人力资源，为社会发展做出贡献。',NULL,391,NULL,'1'),(44,'半自动瓜皮压制机','已登记','自选项目\n','600万元',1,'本项目是创新训练项目，灵山瓜皮在当地是家户喻晓的特色美食，但在全国的其他地方却并没有普及开来，目前当地人们制作黄瓜皮依然用传统的手工来制作，在国内外没有瓜皮制作的机器。成本低康、工艺简单的瓜皮制作机在国内还是具有发展潜力的。本项目主要包括清洗传送装置、打孔装置、加热装置、滚压装置等设计和制作，其核心装置为打孔装置，使传统工艺与先进生产技术相结合，既保存黄瓜鲜脆的口感，又严格监控了产品的安全卫生。',NULL,NULL,19,'1'),(45,'广西梧州特色中草药凉茶的现状调查与发展对策研究','已登记','上级下达','600万元',4,'	凉茶是梧州人的情结，是一个区域饮食文化的构成部分，也是中华民族饮食文化的组成部分，梧州中草药凉茶具有明显的地域性、传承性、稳定性和民族性特征。本项目将详尽调查梧州中草药凉茶的现状（包括产业、销售等现状），并对凉茶文化及其潜在的市场经济价值进行深入探讨，分析梧州凉茶缺乏大力发展的现实条件。通过田野调查梧州凉茶的现状，探讨在现代化快节奏生活下、饮食文化推广方面梧州凉茶应该做出的积极转变，总结可复制和可推广的经验应用到梧州凉茶中，为大力发展梧州凉茶，塑造梧州特色的饮食文化形象和推进区域经济发展作出贡献。',NULL,391,NULL,'1'),(46,'自动翻书机','已登记','上级下达','400万元',1,'本项目主要帮助想阅读纸质书籍，双手却不便的人，通过踩踏按钮控制机器翻页完成阅读。目前国外已有自动翻书机，售价高达数万元，国内没有国产的自动翻书机在售。所以，价格较低、工作可靠、操作方便的自动翻书机是具有发展潜力的。本项目主要包括起页机构 、翻页机构 、压书装置 和角度、高度调节机构等组成，通过搓纸轮在书页下边角的旋转，模拟人手搓页的原理，将书页分离抬起，后由压页杆下压，搓纸轮再度反向旋转，实现自动翻书。\n',NULL,NULL,19,'1'),(47,'南宁那楼镇壮语亲属称谓研究','已登记','上级下达','600万元',4,'	项目研究对象为南宁市邕宁区那楼镇亲属称谓情况。通过实地调查及访谈分析壮语亲属称谓，从语言形成看族群文化心理。通过对南宁市邕宁区那楼壮语亲属称谓的研究来挖掘那楼镇的文化内涵，让更多的人从邕宁区那楼镇的亲属称谓中认识那楼镇的文化内涵，从而增强人们对该地区的风土人情的关注力度及提高人们保护地方特色方言多样性及其文化的意识，从而达到保护地方语言的作用。',NULL,391,NULL,'1'),(48,'自动洗澡机研发与实现','已登记','横向联系单位委托','900万元',1,'智慧城市、智慧社会是目前社会发展的主旋律，而针对人口老龄化的健康养老问题，也已经成为当前我国必须面对和解决的社会问题。我国农村有许多的空巢老人，城市里的年轻人白天出去上班，留下老人独自在家，而因为身体不便，对于独居老人而言洗澡是个麻烦事，而且容易滑倒摔伤，对此，我想研发一款自动洗澡机，以洗衣机滚筒旋转为原理，利用水的旋转流动性与身体磨擦达到清洗效果，加入控制水流速度、水温、脚底按摩和自动喷沐浴液等功能，实现自动洗澡、按摩一体化机器。 窗体底端',NULL,NULL,19,'1'),(49,'广西巴马新型生态养老模式研究','已登记','上级下达','600万元',4,'据全国老龄办发布数据显示，截至2017年底，我国60岁及以上老年人口有2.41亿人，占总人口17.3%。预计到2020年，全国60岁以上老年人口将增加到2.55亿人左右，老年抚养比将提高到28%左右。老龄化已经成为中国社会的一大困惑。随着老龄化社会的到来，日益庞大的老年群体成为一个新兴的消费群体，构成了巨大的老年需求、消费市场，同时也带来了无限的商机。 本项目研究基于人口老龄化背景下，结合广西省河池市巴马长寿之乡的自然条件、人文文化等得天独厚养生资源，将老年人医疗、照护、社交、娱乐等多元化需求与本地地理人文、文化风俗和居民融合，推出 “养生、度假、休闲+养老院”的旅游养老服务,探索出一种新型生态养老模式。该模式主要以建立长期居住的生态养老社区为主，以大力开发一批适宜个人短期居住的度假型养老旅游酒店为辅，为人们提供纯天然的养老服务。',NULL,391,NULL,'1'),(50,'“互联网+”视频直播线上帮扶教学课堂','已登记','上级下达','600万元',4,'近年来，儿童权益越来越受到社会的广泛关注，为了提高儿童整体素质，让儿童获得技能提升，为此本团队提出互联网+帮扶课堂项目想法，并以“5+1+N”新模式为载体。 “5”是指周一至周五的四点半放学之后，困境儿童聚集在儿童之家，配备两地相同的教学设备（电脑、摄像头、音响），大学生志愿者在固定网络教学点，运用视频直播或录制视频的新形式实现互联网+教学，选出班级课代表维持课堂秩序，时长为30分钟。 “1”是指每月一次的教学任务检查，大学生志愿者服务团队下到乡镇进行面对面考核，与儿童进行互动交流，检查作业进度，根据学习任务的完成情况升级学习资源包。 “N”是指在教学活动的过程中，开展多种形式的活动。',NULL,391,NULL,'1'),(51,'冲床自动上下料机器人','已登记','自选项目\n','400万元',6,'冲床自动上下料机器人是一套全新机电结合的思路，它主要有立柱、ARM控制系统、触摸屏人机界面、各种传感器、前后2节机械臂，各自可以在XY平面上绕转动轴自由转动,各自有角度传感器定位每一个手臂的转动角度、用于向值班工人语音播报一些重要信息，例如原料单板有缺陷、安全保护。这项目的实施，将会更加实用与安全，便于生产与推广。现在重点是对智能控制系统的研发，使得这套应用能够实时更新升级，以满足更高的市场需求。',NULL,NULL,19,'1'),(52,'光学显微镜自动聚焦中质量评价窗口构建','已登记','上级下达','600万元',4,'	聚焦窗口的构建是自动聚焦的重要组成部分，对聚焦结果的准确性和实时性具有重要影响。传统的取窗算法包含属于固定构建的中心取窗、多点取窗，以及基于动态取窗的高斯取窗和一阶矩取窗等。本项目对常用的搜索策略的原理和过程进行了研究，在理论上提出了一种新的改进式自动聚焦技术，并给出了具体的操作步骤。最后，对基于数字化图像聚焦深度法的整个过程进行总结，正焦位置搜索将整个聚焦过程串连起来，保证评价函数和搜索算法相辅相成、有条不紊地完成对清晰图像的查找。',NULL,391,NULL,'1'),(53,'基于珀尔贴效应的六堡茶发酵温度测控装置研制','已登记','上级下达','400万元',6,'	本项目通过矩阵排列的光纤传感器采集渥堆发酵中的多处温度，经过低噪声放大及滤波后，将温度信息转换后数字信号，传送到STM32单片机，单片机根据温度数据及分布，通过D/A转换后控制半导体冷却或加热，从而使各处的发酵温度均精确的稳定在设定的温度。',NULL,NULL,19,'1'),(54,'低共熔溶剂分离六堡茶茶叶渣中木质素性能的研究','已登记','自选项目','600万元',4,'	由于本世纪化石资源的日益短缺及生活环境的日渐恶化，木质纤维素这一理想的可再生能源备受青睐。其中，木质素作为唯一一种可再生的含芳香结构的天然高分子资源，利用潜力非常大。若将木质素选择性优先分离，并加以利用，将使得生物质资源的附加值大大提高。但是由于其复杂的化学结构和较差的溶解性，一般方法效率较低。本项目以六堡茶茶叶渣为原料，利用低共熔溶剂预处理工艺，研究了木质素在不同低共熔溶剂中的溶解能力。从而得到一种分离六堡茶茶叶渣中木质素的新途径。',NULL,391,NULL,'1'),(55,'智能无人果栈','已登记','横向联系单位委托','500万元',6,'本项目名为“智能无人果栈”，就是以自助的方式进行水果销售，无售卖人员，只有智能设备售卖。店内配备半自动打包机、智能付款机等设备，用于顾客自行选购、打包和支付。智能无人果栈不仅销售各类新鲜水果，还销售与水果相关的副产品，如果汁、果酱，水果干等产品。另外顾客可网上定购水果，同时结合现有的配送服务进行销售，使顾客体验更加良好、购物更加方便，创立出”智能无人”的销售模式。',NULL,NULL,19,'1'),(56,'智能导盲杖','已登记','自选项目\n','600万元',6,'本款导盲杖是基于Arduino开发板的开发，分智能检测和GPS定位两个独立模块。智能检测模块主要由超声波测距模块、光电测距模块、水位检测模块和遥感模块组成，智能检测模块操作对象为盲人群体，当导盲杖检测到四周有障碍物时发出警报提示使用者注意避让；GPS定位模块可对使用者位置实时定位。模块采用TCP/IP协议与OneNET平台连接，通过AT指令利用GPRS网络将定位数据传送到OneNET平台并以地图形式将位置展现。家人可在OneNET平台地图看到使用者位置和行走轨迹。',NULL,NULL,19,'1'),(57,'木薯渣纳晶纤维素功能化研究','已登记','横向联系单位委托','500万元',6,'以广西特产木薯渣制备的纳晶纤维素为原料，设计与构建以纳米微晶纤维素为载体的药物缓控释系统，在生物医药领域将具有良好的应用前景。但是一般的未经修饰的纳米微晶纤维素并不能直接应用，需要经过进一步的功能化改性，引入多种功能基团或偶联上一些具有特殊性能的分子，从而改善其理化性能，甚至赋予其多种新功能。\n',NULL,NULL,19,'1'),(58,'横经席水溶性活性成分提取工艺的研究','已登记','自选项目\n','600万元',6,'随着人们对中草药需求的增加,以及中药资源经过不断的开采及自然环境的不断恶化,许多重要中草药数量急剧减少，开发新药材的脚步刻不容缓。因此，本项目以横经席为原料药，采用溶液提取法对其活性成分进行提取。通过不同的工艺条件、中药提取工艺学和天然药物化学等知识，研究预处理、提取溶剂、提取时间、提取温度、料液比和提取次数对横经席水溶性活性成分提取率的影响，以此来确定活性成分提取的最佳工艺条件。横经席作为一种鲜为人知却又具有丰富的药用价值的药材，我们理应扩宽其使用途径，让更多人了解到这个价值高的药材。这不仅可以缓解我国现有的中草药资源紧张的情况，同时也是对中草药的可持续发展',NULL,NULL,19,'1'),(59,'基于STM32的多功能爱心水杯','已登记','横向联系单位委托','900万元',6,'日常生活中常用的保温杯确实有保温功能，但是却缺少了人性化。本次项目主要进行基于STM32的多功能爱心水杯的设计，该多功能爱心水杯由传感模块、STM32芯片控制模块、显示模块、接触感应模块、电源供给模块组成。可实现精准温度显示、爱心LED提示、人体信息监测提醒等功能。主要创新点体现在智能提醒，触摸水杯会有爱心LED提示水的温度范围，人体信息监测提醒主要通过传感器来感知人的活动信息，例如是否长期久坐，然后通过LED显屏提醒人适当地运动和喝水等。该项目后期将进行基于互联网+和传统市场的调查和分析，尝试商业推广。\n',NULL,NULL,19,'1'),(60,'丝桐古琴艺术中心','已登记','自选项目\n','500万元',6,'习近平多次强调中华传统文化的历史影响和重要意义，赋予其新的时代内涵。在传统文化复兴的大背景下，近十年来产生了“古琴热”现象。许多人开始兴办琴馆和古琴培训班、层出不穷的古琴雅集活动、古琴考级等等，反映出人们正通过一系列措施来传承和发展传统文化。丝桐古琴文化创业训练项目成立于2019年3月，集结了二十多位来自不同专业的古琴爱好者，秉承传承弘扬古琴文化的宗旨,致力于开授古琴公益课、建立古琴兴趣培训班、古琴及相关用品的实体和网上销售，主要面向广西省桂林、南宁、梧州市等地的在校学生、传统文化爱好者、退休老人等。',NULL,NULL,19,'1'),(61,'阿司匹林双层栓剂的制备和质量考察','已登记','横向联系单位委托','600万元',6,'阿司匹林是一种历史悠久，应用最早，最广和最普通解热镇痛药抗风湿药，目前阿司匹林剂型众多，如阿司匹林片，阿司匹林肠溶片，阿司匹林栓剂，阿司匹林胶囊剂等剂型。阿司匹林具有对肝脏有首过效应，对胃有刺激作用，而传统的阿司匹林栓剂所释放的药物经过向上扩散经门肝系统吸收会造成肝损伤。双层栓剂可以控制药物的释放速度，且能避免部分药物的肝脏首过作用。\n',NULL,NULL,19,'1'),(63,'基于机器视觉的砂糖橘外观品质无损分级检测','已登记','横向联系单位委托','600万元',6,'砂糖橘作为我国的“甜蜜产业”，产量大，种植面广，农户大批量种植收入高。传统水果分级采用人工或纯机械式分选，前者效率低，后者损果率大，机器视觉技术在水果分级中应用的研究，对于降低分级水果过程中的损果率大有裨益，作为一种无损分级，机器视觉在分级分拣中研究意义深厚。 本项目旨在研究砂糖橘的无损分级技术，制作一个附加机构加在砂糖橘打蜡机上，用于降低传统分级技术带来的损果率，根据机器视觉技术对砂糖橘的果围果径进行检测，此设计可以做到不接触果品直接得出果围果径反馈到PC机界面，进而信息传到下一步分拣的工序，达到无损分级检测的目的。',NULL,NULL,19,'1'),(64,'基于“乡村振兴战略”的广西都梅村特色小镇建设研究','已登记','上级下达','200万元',3,'本项目基于国家大力推进“乡村振兴战略”为背景，以乡村发展特色小镇推动乡村走向致富道路为研究目标。通过建设乡村特色小镇，开发特色休闲农业，推动乡村走向致富之路。课题以广西梧州市龙圩区新地镇都梅村为研究对象，该村主要依托当地的特色农业，凭借优越的地理位置，通过流转将闲置土地调整为村集体土地，通过引进外资企业，借助其先进的技术和管理经验来促进乡村特色小镇的发展，建立和完善了相关制度，最终达到乡村振兴的目的。',1,NULL,NULL,'1'),(66,'街旅DIY自拍写真馆','已登记','上级下达','200万元',3,'	自拍写真馆,又名自助摄影馆,是中国摄影行业的一个全新细分市场，个性随意的风格、无限的创业及低廉的价格，是它的核心竞争力。我们拥有更专业的摄影师，有更自由的摄影空间，有更多角度的艺术体验。它颠覆传统的拍摄模式,我们人人都可以当专业的摄影师。馆内提供专业的摄影设备,各式不同的服装,道具,场景。客人可根据自己的喜好选择不同的造型,在不同的场景内完成自拍 所有拍摄过程通过拍摄系统显示在大屏幕上,可以看着自己的效果拍摄。最后客人选择喜欢的照片进行精修,然后打印出照片。收费方式根据自拍时间、人数和照片打印张数多少收费。',1,NULL,NULL,'1'),(67,'非遗手工锤揲工艺在现代茶器设计中的应用','已登记','上级下达','600万元',3,'新潮时代的到来，意味着市场的热潮，产品更迭迅速，在面对消费选择时，往往会根据产品品质及适用度进行对比来选择，有特色的产品会从中脱颖而出，而消费者潜意识中对特色的产品存有理智性的分析，从而选择适合自己且价格合理的商品。所以产品必须以更具艺术感的设计，更好的品质胜出。 本项目创新之处在于把非物质文化遗产——锤揲工艺技术引进高校，通过与学校多专业教学资源相结合，更好的让学生发挥对工艺的传承和对产品造型的创新设计，以及产品在茶文化领域的市场开拓。项目组成员已在传统手工艺制作，有一定经验基础独立完成手工茶具制作，努力实现传承发扬创新。',1,NULL,NULL,'1'),(68,'果真好','已登记','上级下达','600万元',3,'	我们的项目是建立一个平台小程序，果农在平台上售卖水果及水果副产品。果农大部分都是中年人，一般都是选择直接向水果批发商低价卖出，这样他们得到的利润较低，果农们由于存在信息闭塞，不能及时准确获得市场的水果资讯，不是依靠市场导向来进行生产，导致他们丰收不增收，但我们的平台可以有效的帮助他们解决这个问题。 项目首先要经营一个营销公众号，获得大流量大关注后，再搭建一个销售平台APP，让果农和水果加工品合作商可以在平台上销售水果和水果副产品，并建立一个水果资料数据收集库，利用互联网智能分析辅助果农在平台上销售，这样能然让果农收到水果实时的消息，也能更大限度的发挥水果的价值。最后我们在帮助果农的同时，也可以获得一定的收益，共同合作，以达双赢。',1,NULL,NULL,'1'),(69,'基于物联网的果园智能管理系统设计与实现','已登记','自选项目','500万元',3,'本智能果园管理系统以stm32单片机开发、pc机作为上位机,利用WiFi技术实现设备间的无线通信。通过温湿度传感器、光照传感器、土壤湿度传感器以及摄像头模块对果园环境进行实时监测并将所获取的数据上传，方便技术人员对果树的生长情况进行判断合理地对果园进行管理。通过远程控制并与摄像头相结合操作可移动喷洒机器在铁轨上运行进行施肥、施药处理，无需人员费时费力进行操作从而减少人工费的开支以降低成本。将供水设备连接到每棵果树上通过土壤湿度传感器进而控制电磁水阀的开关进行自动灌溉。本智能果园管理系统主要节省了人力，往往一个果园只需要一个人员进行管理或一个人员管理多个果园大大降低了管理成本。',1,NULL,NULL,'1'),(70,'氮素营养和采叶强度互作对采叶后甜茶补偿性生长的影响','已登记','横向联系单位委托','200万元',5,'	甜茶为广西特有的茶、糖、药多用资源植物，主要有效成分为叶片提取的甜茶苷，近年来，我区已将甜茶作为产业扶贫的重点资源植物在桂北及桂东贫困山区进行了大面积的人工种植。在众多的环境因素中，与生产最密切又易人为调控的是矿质营养，其中氮是最重要的基础营养元素。本项目以甜茶为材料，研究氮素营养和采叶强度互作对采叶后甜茶补偿性生长的影响，为甜茶栽培管理提供理论依据和实践指导。',1,NULL,NULL,'1'),(71,'生物调节剂对两面针的矮化效果及生理特性变化研究','已登记','上级下达','300万元',5,'	两面针为芸香科花椒属植物，是广西道地中药材，瑶药中五虎之首。具有镇痛、抗炎、抗菌、抗癌等作用，是医药、日用品、化妆品的原料药，随着生产规模的扩大，两面针的年需求量也逐年增加。但市场需求与两面针野生资源间的不平衡，让人工种植面积日益扩大。 在栽培过程中，鉴于两面针茎枝叶有锐刺、分枝多，以根入药而使茎枝叶无法利用，以及生长势快的特点，使得管理困难、影响效益。而矮化可有效解决该问题，因此本项目开展的生长调节剂对两面针的矮化效果及生理特性变化研究不仅意义重大，还可为两面针的种植提供新的模式，进而提高产值，加快两面针产业化的发展。',1,NULL,NULL,'1'),(72,'大学生党员党性现状调查—以梧州学院为例','已登记','上级下达','300万元',4,'	大学生党员具备较高的党性修养是实现伟大复兴中国梦和加强党的建设的现实要求。本项目通过对梧州学院的大学生党员党性现状的调查，把握大学生党员的群体特点。有针对性的对学校相关老师、学生党员、群众进行访问调研，通过将大学生党员与在职党员、群众进行比较，了解在新时代大学生党员在党性培养与增强过程中存在的问题和不足，并形成调研报告提供给学校乃至广西其他高校借鉴。',1,NULL,NULL,'1'),(73,'Nice旅行社','已登记','上级下达','300万元',5,'	Nice旅行社是以“青春飞扬、以人为本、旅客满意、永续经营、万源诚为本”的经营理念。旨在满足广大消费群体的需求，秉承一贯的“诚信、用心、安全、负责”的初衷，并且在提供轻松、欢快、安乐、周到服务的同时，倡导时尚旅游新概念，推出个性化产品，追求更高品质的服务为广大青年学生打造舒适、理想的旅程。我们团队现已与南宁中旅达成合作意向，提供更全面的技术支持，更专业的业务培训，更有力度的宣传推广和丰富的经验。以“低价位高服务，重安全得尊重”为宗旨，年轻，精干，诚实团结的业务队伍；踏实，谦虚，勤奋，负责的敬业精神是我们发展壮大的基础条件和资本。创业初期主要顾客群体以在校大学生为主，中后期可兼顾社会旅游群体。旅游地点不限，国内与境外游，尽团队最大的能力满足大学生的需求。也正因为这个团队是由大学生组建成的团队才能更明白大学生的消费心理，也才能想出一些可行的点子来契合消费群体的需求。旅游是当之无愧的“美好生活',1,NULL,NULL,'1'),(74,'基于NB-IOT的空气质量监控和污染源定位系统','已登记','上级下达','600万元',5,'	习近平总书记在党的十九大报告中指出，“必须树立和践行绿水青山就是金山银山的理念”，并明确要求“加大生态系统保护力度”。至此，为了响应习近平总书记对环境保护和治理的号召，我们拟研发了基于NB-IOT的空气质量监控和污染源定位系统，该系统由下位机、Web端、设备监控端、移动客户端和数据服务器构成。在工厂和城市地区附近安装多个传感器，采集的环境参数有风速、风向、PM2.5、PM10、温度、湿度、光照强度、GPS信息。下位机采集数据发送到电信物联网开发者平台， Web端实现了数据的显示、设备监控和污染源定位，帮助环保管理人员寻找到排放污染物超标或者偷排的工厂。移动客户端对未来的环境指数进行预测和显示，如有异常将以短信方式提醒。',1,NULL,NULL,'1'),(75,'用电检测系统的设计与实现','已登记','横向联系单位委托','600万元',3,'本团队的设计是在用电器与供电线路之间搭建一个监测系统，给系统部署一个用电标准值，实时的进行用电参数监测，系统检测到用电线路过载，线路温度过高或者电压不足时会发出报警信息提醒用户，并将数据信息上传后台方便管理员和用户查询，超出标准值值系统将自动断开电源，避免意外发生。电检测系统可用于大型公司、大型用电集团、小区使用，方便有关部门的统一管理和用电居民的节约、安全用电，避免危险用电，防患于未然。',1,NULL,NULL,'1'),(76,'罗汉果抗根结线虫种质初步筛选','已登记','上级下达','600万元',5,'	罗汉属葫芦科多年生藤本植物，为广西道地药材和著名特产。它是一种高度易感线虫的植物，现已危害到了罗汉果果实的品质和产量，并影响了罗汉果产业的可持续发展。为有效解决或缓解罗汉果根结线虫病害问题，本项目通过罗汉果抗根结线虫种质初步筛选、外源水杨酸、茉莉酸诱导罗汉果抗根结线虫性以及抗虫性生理指标分析，可初步筛选出罗汉果抗根结线虫的优良种质和砧木，了解罗汉果和葫芦科的抗虫性生理，为今后罗汉果抗根结线虫优良种质应用提供材料和理论基础。',1,NULL,NULL,'1');
