INSERT INTO `sys_role` VALUES (1,'超级管理员','唯一，能管理所有用户和数据，拥有所有管理权限',1,'2018-10-18 16:13:20'),(2,'项目负责人','由学生本人作为项目、参赛队伍的负责人在系统中注册账号，账号生成后，可拥有功能模块一、功能模块二、功能模块三的报名、个人信息填写、修改，并提交给指导老师账号的权限',1,'2018-11-06 21:46:21'),(3,'指导老师','账号由管理员提供，并赋予审核、修改学生账号的报名信息、将材料提交给上一级账号审核或否决学生材料的权限',1,'2018-11-06 21:46:53'),(4,'二级学院','账号由管理员提供，并赋予审核指导老师提交材料、向上一级账号提交材料或否决指导老师材料的权限',1,'2018-11-07 09:12:34'),(5,'管理员','由创新创业教育学院工作人员担任，拥有提供账号、赋予账号权限等级、材料的最终审核的权限',1,'2018-11-07 09:12:47'),(6,'评委','账号由管理员提供，并赋予给相关材料打分、审核的权限',1,'2018-11-07 09:13:14'),(7,'企业用户','账号有企业自行注册，默认企业注册角色。高新区或者其他地区企业用户角色。',1,'2019-09-20 13:39:03'),(8,'创新创业学院企业入驻审核管理员','唯一，可指派多人，创新创业学院企业入驻审核管理员，审核非高新区企业',1,'2019-10-23 15:43:31'),(9,'高新技术开发区管理员','唯一，可指派多人，高新技术开发区管理员',1,'2019-09-23 16:04:15'),(10,'校企合作超级管理员','拥有校企合作里面的最高权限',1,'2019-09-27 10:37:18'),(11,'学生','本校学生',1,'2019-10-23 12:40:40'),(12,'老师','本校老师',1,'2019-10-23 12:41:40'),(13,'区块链存证审批员','区块链存证审批员',1,'2020-08-07 11:36:30');
